import React from 'react';
import { Container, Row, Col } from 'reactstrap';

import img from '../../imgs/16-Waycaster125633-R1-E011.jpg'

function RouteOne() {
    console.log("Rendered path '/route-1' - RouteOne.");

    const style = {
        backgroundImage: 'url(' + img + ')',
        // height: '70vh',
        width: '50vw',
        paddingTop: '50vw',
        backgroundPosition: 'bottom',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        // filter: 'grayscale(100%)'
        margin: 'auto',
        transitionDuration: '1200ms',
        transitionTimingFunction: 'ease'

    }

    return (
        <div className="page-wrapper">
            <Container>
                <Row>
                    <Col lg={12}>
                        <p style={{ fontSize: '1.1rem', fontWeight: 400,  textTransform: 'uppercase', margin: 'auto', width: '50vw'}}>Shia Ridge - Calgary, Wyoming</p>
                        <div style={style}></div>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default RouteOne
